        "content": {
            "text": "In this work, we propose an alternative paradigm of human-AIcollaboration — conditional delegation. Fig. 1(A) illustrates a generalform of conditional delegation. Human and AI work together toidentify trustworthy regions of AI before deployment, i.e., modeldecisions are reliable or trustworthy for examples within theseregions. Once deployed, the AI model only affects decisions forinstances in the trustworthy regions. For the rest, another set ofactions can be taken such as manual review or employing a differentmodel since the given AI’s decisions on them cannot be trusted.This approach employs a greater level of automation than human-AI collaboration on every single decision and provides human withactive control on when to use an AI model and in what ways."
        },
